// Local storage

const DEFAULT_BTC_ENDPOINT = 'https://ancient-crimson-rain.btc.discover.quiknode.pro/c268fb026303ae8443f785200f2ea4b82f0082dd';

function setBlocksApiEndpoint(endpoint) {
  if (isNullOrEmpty(endpoint)) {
    localStorage.removeItem('blocksApiEndpoint');
  } else {
    localStorage.blocksApiEndpoint = endpoint;
  }
}

function getBlocksApiEndpoint() {
  return localStorage.blocksApiEndpoint || DEFAULT_BTC_ENDPOINT;
}

function setModelInscriptionEndpoint(endpoint) {
  if (isNullOrEmpty(endpoint)) {
    localStorage.removeItem('modelInscriptionEndpoint');
  } else {
    localStorage.modelInscriptionEndpoint = endpoint;
  }
}

function getModelInscriptionEndpoint() {
  return localStorage.modelInscriptionEndpoint;
}

// Remote API

async function fetchData(endpoint, options) {
  try {
    const response = await fetch(endpoint, options);
    const data = await response.json();
    return data;
  } catch (err) {
    console.log(err);
    return null;
  }
}

async function sendBtcRequest(endpoint, method, params) {
  const paramsStr = `[${params.join(sep=',')}]`;
  
  const options = {
    method: 'POST',
    headers: {'Content-Type': 'application/json'},
    body: `{"jsonrpc":"2.0","id":1,"method":"${method}","params":${paramsStr}}`
  };
  
  let data = await fetchData(endpoint, options);
  return data?.result;
}

async function getLatestBlockStats(endpoint) {
  const defaultStats = {
    avgfee: 10,
    time: Date.now() / 1000,
  };
  return await getValidBlocksApi(endpoint) || await getValidBlocksApi(DEFAULT_BTC_ENDPOINT) || defaultStats;
}

async function getModelInscription(endpoint) {
  return await getValidModelInscription(endpoint) || ___default_inscription;
}

async function isValidBlocksApiEndpoint(endpoint) {
  return isNullOrEmpty(endpoint) || await getValidBlocksApi(endpoint) != null;
}

async function isValidModelInscriptionEndpoint(endpoint) {  
  return isNullOrEmpty(endpoint) || await getValidModelInscription(endpoint) != null;
}

async function getValidBlocksApi(endpoint) {
  if (isNullOrEmpty(endpoint)) return null;
  const blockId = await sendBtcRequest(endpoint, 'getblockcount', []);
  if (blockId == null) return null;
  const stats = await sendBtcRequest(endpoint, 'getblockstats', [blockId]);
  return verifyBlockStats(stats) ? stats : null;
}

async function getValidModelInscription(endpoint) {
  if (isNullOrEmpty(endpoint)) return null;
  const inscription = await fetchData(endpoint, {});
  return verifyModelInscription(inscription) ? inscription : null;
}

function verifyBlockStats(stats) {
  return typeof stats?.time == 'number'
      && typeof stats?.avgfee == 'number';
}

function verifyModelInscription(inscription) {
  if (inscription == null) return false;

  const { classes_name, training_traits, layers_config, weight_b64 } = inscription;

  if (!Array.isArray(classes_name)) return false;
  if (training_traits == null) return false;
  try {
    loadModel(layers_config, weight_b64);
  } catch (err) {
    return false;
  }

  return true;
}

